-- constants
local SCREEN_W, SCREEN_H = 240, 136
local TILE = 8
local GRAVITY = 0.70
local FRICTION = 0.75
local AIR = 0.90

-- flags used in map (set these to match your sprite flags)
local FLAG_SOLID  = 0  -- fget(...,0)
local FLAG_HAZARD = 1  -- bit 1 value 2
local FLAG_WALL   = 2  -- bit 2 value 4 (for wall slide)

-- time
local t = 0
local now = 0

-- camera
local camera = { x=0, y=0 }

-- state enum
ST = {NONE=0,IDLE=1,RUN=2,JUMP=3,FALL=4,WALL=5,CRAWL=6,ATTACK=7,DEATH=8}

-- game state machine
local game_state = "title"
local next_state = "game"

-- input env (bitfields for 8 flags around the player)
local env = { up=0, down=0, left=0, right=0 }

-- player
player = {
	x = 400,
	y = 24,
	w = 16,
	h = 16,
	dx = 0,
	dy = 0,
	speed = 2,
	jump  = 6,
	on_ground = false,
	anim = idle_animation,
	state = ST.IDLE,
	action = ST.NONE,
	anim_counter = 0,
	anim_loop = 1,
	flip = 0,
	jumps = 0,
	max_jumps = 2,
	dmg_cd = 0,
	hp = 3,
	ox = 4,
	wall = -1,
}

enemies = {}

function spawn_patroller(x,y)
  table.insert(enemies, 
  {x=x, y=y, w=16, h=16, dx=0.5, dy=0, dir=1, left=x-64, right=x+64, hp=2, alive=true, ox=0, flip = 0})
end

function enemy_update(e)
  -- patrol bounds
  if e.x < e.left then e.dir = 1 end
  if e.x > e.right then e.dir = -1 end
  e.dx = 0.5 * e.dir

  -- basic gravity + tile stop (reuse your helpers)
  e.dy = math.min(e.dy + GRAVITY, 7)
  -- x collide
  local savedx = e.dx
  collision_x(e)
  e.x = e.x + e.dx
  -- y collide
  collision_y(e)
  e.y = e.y + e.dy
  if e.dx == 0 then e.dir = -e.dir end -- bounced on wall

  -- hurt player on touch (only if player not invuln)
  if e.alive and player.dmg_cd == 0 and aabb(e, player) then
    player.hp = player.hp - 1
    player.dmg_cd = 60
    player.dx = (player.x < e.x) and -2 or 2
    player.dy = -3
  end
end

function enemy_draw(e)
	if e.alive then
    -- pick any small sprite you like; using 240 as placeholder heart implies change it
	local spr_num = 400
	if (t % 32 < 16) then spr_num = spr_num + 2 end
	if e.dx > 0 then e.flip = 0 end
	if e.dx < 0 then e.flip = 1 end

    spr(spr_num, e.x - camera.x, e.y, 5, 1, e.flip, 0, 2, 2)
	end
end

function aabb(a,b)
  return a.x < b.x + b.w and b.x < a.x + a.w and
         a.y < b.y + b.h and b.y < a.y + a.h
end

function player_attack_hitbox()
  local f = player.anim_counter
  if f == 0 then
    return { x = player.x + 18*player.flip - 4, y = player.y + 4, w = 8, h = 8 }
  elseif f == 1 then
    return { x = player.x - 9 + 18*player.flip, y = player.y, w = 16, h = 8 }
  elseif f == 2 then
    return { x = player.x + 7 - 6*player.flip, y = player.y - 4, w = 16, h = 12 }
  elseif f == 3 then
    return { x = player.x + 4, y = player.y + 8, w = 8, h = 8 }
  end
  return nil
end

-- animations
local ANIM = {
  [ST.IDLE]   = {id=256, num=4,  speed=16, w=2, h=2, type=2},
  [ST.RUN]    = {id=288, num=6,  speed=6,  w=2, h=2, type=1},
  [ST.JUMP]   = {id=300, num=2,  speed=4,  w=2, h=2, type=1},
  [ST.FALL]   = {id=320, num=2,  speed=2,  w=2, h=2, type=0},
  [ST.DEATH]  = {id=264, num=4,  speed=16, w=2, h=2, type=0},
  [ST.CRAWL]  = {id=364, num=1,  speed=2,  w=2, h=2, type=0},
  [ST.WALL]   = {id=366, num=1,  speed=2,  w=2, h=2, type=0},
  [ST.ATTACK] = {id=328, num=4,  speed=6,  w=2, h=2, type=1},
}

function TIC()
	if game_state == "title" then
		draw_title()
	elseif game_state == "loading" then
		draw_loading()
	elseif game_state == "game" then
		draw_game()
	end
	t=t+1
end

tmp = 0
function draw_title()
	sync(0,0,false)
	map(0,0,30,17,0,0,-1,1)
	local frame = math.floor(t%120/40)
	spr(416 + 32*frame,72,96,-1,1,0,0, 12, 2)
	if btnp(4) then
		game_init()
		game_state = "loading"
		next_state = "game"
		now = t
	end
end

function draw_loading()
	local d = 60
	local y = 0

	if t-now > 2*d then
		game_state = next_state
		return
	elseif t-now < d then
		y = (160/d)*(t-now)
	else
		if next_state == "game" then
			game_init()
			draw_map()
		else
			draw_title()
		end
		y = (160/d)*(2*d + now - t)
	end

	for i=0,240/5 do
		line(i*5+0,0,i*5+0,y+0,15)
		line(i*5+1,0,i*5+1,y+1,14)
		line(i*5+2,0,i*5+2,y+2,14)
		line(i*5+3,0,i*5+3,y+2,14)
		line(i*5+4,0,i*5+4,y+1,14)
	end
	
end

function draw_game()
	if player.hp <= 0 and player.dmg_cd <= 1 then
		game_state = "loading"
		next_state = "title"
		now = t
	else
		cls()
		draw_map()
		for _, e in ipairs(enemies) do
			enemy_update(e)
		end
		player_update()
		for _, e in ipairs(enemies) do
			enemy_draw(e)
		end
		player_draw()
		draw_ui()	
	end	
end

function camera_update()
    camera.x = player.x - 120  -- 240 / 2
    --camera.y = player.y - 68   -- 136 / 2

    camera.x = math.max(0, math.min(camera.x, (240*8)-240))
    --camera.y = math.max(0, math.min(camera.y, (136*8)-136))
end

function draw_map()
	camera_update()
	local map_x = math.floor(camera.x / 8)
	local map_y = math.floor(camera.y / 8)
	local offset_x = -(camera.x % 8)
	local offset_y = -(camera.y % 8)
	map(map_x, map_y, 31, 18, offset_x, offset_y)
end

function draw_ui()
	for i = 0, player.hp - 1, 1 do
		spr(240, 1 + i*9, 1, 1)
	end
end

function game_init()
	sync(0,1,false)
	player.x = 400
	player.y = 24
	player.hp = 3
	player.state = ST.IDLE
	enemies = {}
	--spawn_patroller(440, 32)
	spawn_patroller(520, 32)
end

function player_input()
	-- movement --
	if btn(2) then player.dx = -player.speed end
	if btn(3) then player.dx =  player.speed end

	if (btnp(0) or btnp(4)) and 
    player.jumps < player.max_jumps then
		player.jumps = player.jumps + 1
		player.dy = -player.jump
		if player.state == ST.WALL then
			player.dx = - (player.speed - 2*player.flip*player.speed)
		end
	end

	if btn(1) and player.dx == 0 and player.dy == 0 then 
		player.action = ST.CRAWL
	end
	if btn(5) then
		player.action = ST.ATTACK
	end

end

function draw_attack()
	if player.anim_counter == 0 then
		spr(480, player.x + 18*player.flip - 4 - camera.x, player.y + 4, 5, 1, player.flip, 0, 1, 1)
	elseif player.anim_counter == 1 then
		spr(448, player.x - 9 + 18*player.flip - camera.x, player.y, 5, 1, player.flip, 0, 2, 1)
	elseif player.anim_counter == 2 then
		spr(465, player.x + 15 - 22*player.flip - camera.x, player.y - 4, 5, 1, player.flip, 0, 1, 3)
		spr(464, player.x + 7 - 6*player.flip - camera.x, player.y - 4, 5, 1, player.flip, 0, 1, 1)
	elseif player.anim_counter == 3 then
		spr(496, player.x + 4 - camera.x, player.y + 8, 5, 1, player.flip, 0, 1, 1)
	end
end

function player_draw()
	if (player.dmg_cd == 0) or player.state == ST.DEATH or(t % 6 < 2) then
		player.anim = ANIM[player.state]
		player.anim_counter = draw_object(player)
		if player.state == ST.DEATH then
			print("YOU DIED!", 74, 62, 14, false, 2)
			print("YOU DIED!", 75, 63, 15, false, 2)
		elseif player.state == ST.ATTACK then
			draw_attack()
		end
	end
	
end

function player_enter(state)
	player.state = state
	player.anim_counter = 0
	player.anim_loop = 1

	if state == ST.WALL then
		if player.wall ~= player.flip then
			player.wall = player.flip
		else
			player.state = ST.FALL
		end
	end

end

function want_wall()
	return (env.left & (1<<2) ~= 0 or env.right & (1<<2) ~= 0) --and player.wall ~= player.flip
end

function player_states()
	if player.dx < 0 then player.flip = 1
	elseif player.dx > 0 then player.flip = 0 end

	if player.hp <= 0 then return ST.DEATH end
	if player.action == ST.ATTACK then player.action = ST.NONE return ST.ATTACK end
	if player.action == ST.CRAWL then player.action = ST.NONE return ST.CRAWL end
	if player.dy < 0 then return ST.JUMP end
	if not player.on_ground then
		if want_wall() then --and player.wall ~= player.flip then 
			player.jumps = 1
			return ST.WALL
		end
		return ST.FALL
	end
	if player.dx ~= 0 then return ST.RUN end
	return ST.IDLE
end

function player_update()
	if player.on_ground == true then
		player.jumps = 0
		player.wall = -1
	end
	if player.state ~= ST.DEATH then 
		player_input()
		local new_state = player_states()
		if new_state ~= player.state then player_enter(new_state) end
		check_env(player)
	end

    gravity(player)
	collision_x(player)
	player.x = player.x + player.dx
	collision_y(player)
	player.y = player.y + player.dy

	if player.state == ST.ATTACK then
	local hb = player_attack_hitbox()
		if hb then
			for _, e in ipairs(enemies) do
				if e.alive and aabb(hb, e) then
					e.hp = e.hp - 1
					e.dx = (player.flip==0) and 1.5 or -1.5
					e.dy = -1.5
					if e.hp <= 0 then e.alive = false end
				end
			end
		end
	end

	if player.dmg_cd > 0 then
		player.dmg_cd = player.dmg_cd - 1
	end    
end

function get_flags(obj)
	local top_left  = {x = (obj.x + obj.ox),             y = (obj.y)}
	local bot_left  = {x = (obj.x + obj.ox),             y = (obj.y + obj.h - 1)}
	local top_right = {x = (obj.x + obj.w - 1 - obj.ox), y = (obj.y)}
	local bot_right = {x = (obj.x + obj.w - 1 - obj.ox), y = (obj.y + obj.h - 1)}
	local mid_left  = getMidpoint(top_left,  bot_left)
	local mid_right = getMidpoint(top_right, bot_right)
	local top_mid   = getMidpoint(top_left, top_right)
	local bot_mid   = getMidpoint(bot_left, bot_right)

	env["up"]    = 0
	env["down"]  = 0
	env["left"]  = 0
	env["right"] = 0

    for flag=0,7 do
		local MASK = 1<<flag
        -- up
        if fget(mget(top_left.x/8,  (top_left.y - 1)/8) , flag) or
		   fget(mget(top_mid.x/8,   (top_mid.y - 1)/8)  , flag) or
		   fget(mget(top_right.x/8, (top_right.y - 1)/8), flag) then
			env["up"] = env["up"] | MASK
		end
        -- down
        if fget(mget(bot_left.x/8,  (bot_left.y + 1)/8) , flag) or
		   fget(mget(bot_mid.x/8,   (bot_mid.y + 1)/8)  , flag) or
		   fget(mget(bot_right.x/8, (bot_right.y + 1)/8), flag) then
			env["down"] = env["down"] | MASK
		end
        -- left
        if fget(mget((top_left.x -1)/8, top_left.y/8), flag) or
		   fget(mget((mid_left.x -1)/8, mid_left.y/8), flag) or
		   fget(mget((bot_left.x -1)/8, bot_left.y/8), flag) then
			env["left"] = env["left"] | MASK
		end
        -- right
		if fget(mget((top_right.x +1)/8, top_right.y/8), flag) or
		   fget(mget((mid_right.x +1)/8, mid_right.y/8), flag) or
		   fget(mget((bot_right.x +1)/8, bot_right.y/8), flag) then
			env["right"] = env["right"] | MASK
		end
    end
end

function check_env(obj)
    get_flags(obj)

    if (env["up"] & 2) > 0  and obj.dmg_cd == 0 then
        obj.dy = 4
		obj.hp = obj.hp - 1
		obj.dmg_cd = 60
    elseif (env["down"] & 2) > 0 and obj.dmg_cd == 0 then
		obj.dy = -4
		obj.hp = obj.hp - 1
		obj.dmg_cd = 60
    elseif (env["left"] & 2) > 0 and obj.dmg_cd == 0 then
		obj.dx = 4
		obj.hp = obj.hp - 1
		obj.dmg_cd = 60
    elseif (env["right"] & 2) > 0 and obj.dmg_cd == 0 then
		obj.dx = -4
		obj.hp = obj.hp - 1
		obj.dmg_cd = 60
    end
end

function draw_object(obj)
	if t % obj.anim.speed == 0 then
		obj.anim_counter = obj.anim_counter + obj.anim_loop
		if obj.anim_counter == obj.anim.num then
			if obj.anim.type == 0 then
				obj.anim_counter = obj.anim.num -1
			elseif obj.anim.type == 1 then
				obj.anim_counter = 0
			elseif obj.anim.type == 2 then
				obj.anim_counter = obj.anim.num -1
				obj.anim_loop = -obj.anim_loop
			end
		elseif obj.anim_counter == -1 then
			if obj.anim.type == 2 then
				obj.anim_counter = 0
				obj.anim_loop = -obj.anim_loop
			end
		end
	end
	
	local offset_rows = math.floor(obj.anim.id/(16 * obj.anim.h))
	local offset_cols = (obj.anim.id - (offset_rows * 16 * obj.anim.h)) / obj.anim.w
	local offset = offset_rows * 8 + offset_cols
	local sprite_id = ((obj.anim_counter + offset) * obj.anim.w) % 16 + math.floor((obj.anim_counter +offset) * obj.anim.w / 16) * 16 * obj.anim.h
	spr(sprite_id, obj.x - camera.x, obj.y, 5, 1, obj.flip, 0, obj.anim.w, obj.anim.h)

	return obj.anim_counter
end

-- gravity --
function apply_drag(v, factor)
	v = v*factor
	if math.abs(v) < 0.05 then return 0 end
	return v
end

function gravity(obj)
    if obj.on_ground == false then
		if obj.state == ST.WALL then
			obj.dy = math.min(obj.dy + 0.1, 0.4)
		else
			obj.dy = math.min(obj.dy + GRAVITY, 7)
		end
	end

	obj.dx = apply_drag(obj.dx, obj.on_ground and FRICTION or AIR)
end

-- collisions --
function getMidpoint(p1, p2)
  local midX = math.floor((p1.x + p2.x) / 2)
  local midY = math.floor((p1.y + p2.y) / 2)
  return {x = midX, y = midY}
end

function collision_x(obj)
    -- x axis --
    local top_left  = {x = (obj.x - 1 + obj.ox + obj.dx),      y = (obj.y)}
    local top_right = {x = (obj.x + obj.w - obj.ox + obj.dx),  y = (obj.y)}
    local bot_left  = {x = (obj.x - 1 + obj.ox + obj.dx),      y = (obj.y + obj.h - 1)}
    local bot_right = {x = (obj.x + obj.w - obj.ox + obj.dx),  y = (obj.y + obj.h - 1)}
    local mid_left  = getMidpoint(top_left,  bot_left)
    local mid_right = getMidpoint(top_right, bot_right)

    if fget(mget(top_left.x/8, top_left.y/8),0) or
       fget(mget(mid_left.x/8, mid_left.y/8),0) or
       fget(mget(bot_left.x/8, bot_left.y/8),0) then
        if obj.dx < 0 then
		    obj.dx = math.ceil(top_left.x/8)*8 - (obj.x + obj.ox)
        end
    end

    if fget(mget(top_right.x/8, top_right.y/8),0) or
       fget(mget(mid_right.x/8, mid_right.y/8),0) or
       fget(mget(bot_right.x/8, bot_right.y/8),0) then
        if obj.dx > 0 then
            obj.dx = math.floor((top_right.x)/8)*8 - (obj.x + obj.w - obj.ox)
        end
    end
end

function collision_y(obj)
    -- y axis --
    local top_left  = {x = (obj.x + obj.ox),      		 y = (obj.y - 1 + obj.dy)}
    local top_right = {x = (obj.x + obj.w -1 - obj.ox),  y = (obj.y - 1 + obj.dy)}
    local bot_left  = {x = (obj.x + obj.ox),      	     y = (obj.y + obj.h + obj.dy)}
    local bot_right = {x = (obj.x + obj.w -1 - obj.ox),  y = (obj.y + obj.h + obj.dy)}
    local top_mid   = getMidpoint(top_left, top_right)
    local bot_mid   = getMidpoint(bot_left, bot_right)

    if fget(mget(top_left.x/8,  top_left.y/8),0) or
       fget(mget(top_mid.x/8,   top_mid.y/8),0) or
       fget(mget(top_right.x/8, top_right.y/8),0) then
        if obj.dy < 0 then
		    obj.dy = math.ceil(top_mid.y/8)*8 - (obj.y)
        end
    end

    if (fget(mget(bot_left.x/8,  bot_left.y/8),0) or
       fget(mget(bot_mid.x/8,   bot_mid.y/8),0) or
       fget(mget(bot_right.x/8, bot_right.y/8),0)) then
		obj.on_ground = true
		if obj.dy > 0 then
            obj.dy = math.floor(bot_mid.y/8)*8 - (obj.y + obj.h)
        end
	else
		obj.on_ground = false
	end
end

